addOperation.body:
@Operation getInstanceNamesList[monitor=false,delToClassAllowed=false]():XCore::Seq(XCore::String)
  let a = Seq{}
  in self.getInstanceList()->collect(i |
       a := a + Seq{i.name});
     a
  end
end

@Operation getParamValuesAsList[monitor=true,delToClassAllowed=false]():XCore::Element
  let a = Seq{} then
      b = Seq{} then
      c = Seq{} then
      d = Seq{} then
      e = "" then
      h = "" then
      m = "" then
      f = Root::Auxiliary::Date then
      i = 0
  in @For obj in self.getParameters() do
       if obj.getDataType() = "Integer"
       then 
         a := a + Seq{obj.getValue().asInt()};
         b := b + Seq{obj.getOrderNo()}
       else false
       end ;
       if obj.getDataType() = "Float"
       then 
         a := a + Seq{obj.getValue().asFloat()};
         b := b + Seq{obj.getOrderNo()}
       else false
       end ;
       if obj.getDataType() = "Date"
       then 
         e := obj.getValue();
         h := e.splitBy(" ",0,0);
         f := f.new();
         if h.at(1) = "Jan"
         then m := 1
         else false
         end ;
         if h.at(1) = "Feb"
         then m := 2
         else false
         end ;
         if h.at(1) = "Mar"
         then m := 3
         else false
         end ;
         if h.at(1) = "Apr"
         then m := 4
         else false
         end ;
         if h.at(1) = "May"
         then m := 5
         else false
         end ;
         if h.at(1) = "Jun"
         then m := 6
         else false
         end ;
         if h.at(1) = "Jul"
         then m := 7
         else false
         end ;
         if h.at(1) = "Aug"
         then m := 8
         else false
         end ;
         if h.at(1) = "Sep"
         then m := 9
         else false
         end ;
         if h.at(1) = "Oct"
         then m := 10
         else false
         end ;
         if h.at(1) = "Nov"
         then m := 11
         else false
         end ;
         if h.at(1) = "Dec"
         then m := 12
         else false
         end ;
         f := f.createDate(h.at(2).asInt(),m,h.at(0).asInt());
         a := a + Seq{f};
         b := b + Seq{obj.getOrderNo()}
       else false
       end ;
       if obj.getDataType() = "String"
       then 
         a := a + Seq{obj.getValue()};
         b := b + Seq{obj.getOrderNo()}
       else false
       end 
     end;
     @While not b->isEmpty do
       c := c + Seq{a.at(b.indexOf(b->max))};
       a := a.removeAt(b.indexOf(b->max));
       b := b.removeAt(b.indexOf(b->max))
     end;
     if c.size() <> 0
     then 
       i := c.size() - 1;
       @While i >= 0 do
         d := d + Seq{c.at(i)};
         i := i - 1
       end
     else false
     end ;
     d
  end
end

@Operation getSlotValue[monitor=false,delToClassAllowed=false]():XCore::String
  let a = self.getReference().getCommonClass() then
      ret = null
  in @While a.name.toString() <> "MetaClass" do
       if a.hasSlot(self.nameOfModelElement)
       then ret := a.get(self.nameOfModelElement)
       else false
       end ;
       a := a.of()
     end;
     ret
  end
end

@Operation selectNewInstance[monitor=false,delToClassAllowed=false](idUI : XCore::String,instanceName : XCore::String):XCore::Element
  let a = self.getInstanceByID(idUI).asSeq().at(0)
  in a.getReference().changeCommonClass(instanceName)
  end
end

@Operation sendMessage[monitor=false,delToClassAllowed=false](idUI : XCore::String,eventID : XCore::String):XCore::Element
  let a = self.getInstanceByID(idUI)
  in @For obj in a.asSeq() do
       if (obj.getEventName().toString() = eventID)
       then obj.runAction()
       else false
       end 
     end
  end
end

@Operation setParameterValue[monitor=false,delToClassAllowed=false](idUI : XCore::String,valueAsString : XCore::String):XCore::Element
  let a = self.getInstanceByID(idUI).asSeq().at(0)
  in try
       a.getParameter().setValue(valueAsString);
       true
     catch(ex)
       false
     end
  end
end
